{
  "translationLines": [
    {
      "lineNumber": 79941,
      "originalJapaneseLine": "「っ！　くっ！」",
      "translatedEnglishLine": "\"Tch! Ugh!\""
    },
    {
      "lineNumber": 79942,
      "originalJapaneseLine": "頭を叩き潰さん勢いの政宗の一刀が",
      "translatedEnglishLine": "Masamune's strike, with the force to smash the head,"
    },
    {
      "lineNumber": 79943,
      "originalJapaneseLine": "振り下ろされ、アリオスは自分を支えていた",
      "translatedEnglishLine": "was swung down, and Arios had to use"
    },
    {
      "lineNumber": 79944,
      "originalJapaneseLine": "エスクードソードを防御に使わざるを得ない。",
      "translatedEnglishLine": "his Escudo Sword to defend himself."
    },
    {
      "lineNumber": 79945,
      "originalJapaneseLine": "「……ッ！",
      "translatedEnglishLine": "\"...Tch!\""
    },
    {
      "lineNumber": 79946,
      "originalJapaneseLine": "　ここまで、来て……！」",
      "translatedEnglishLine": "\"To come this far...!\""
    },
    {
      "lineNumber": 79947,
      "originalJapaneseLine": "そして――",
      "translatedEnglishLine": "And then――"
    },
    {
      "lineNumber": 79948,
      "originalJapaneseLine": "アリオスは穴に吸い込まれるように",
      "translatedEnglishLine": "Arios fell as if being sucked into a hole"
    },
    {
      "lineNumber": 79949,
      "originalJapaneseLine": "落ちていった。",
      "translatedEnglishLine": "and dropped down."
    },
    {
      "lineNumber": 79950,
      "originalJapaneseLine": "「な、なんだぁ……」",
      "translatedEnglishLine": "\"W-What was that...?\""
    },
    {
      "lineNumber": 79951,
      "originalJapaneseLine": "「今、何が起こったんだ？」",
      "translatedEnglishLine": "\"What just happened now?\""
    },
    {
      "lineNumber": 79952,
      "originalJapaneseLine": "「はあ、はあ……はあ……」",
      "translatedEnglishLine": "\"Hah, hah... hah...\""
    },
    {
      "lineNumber": 79953,
      "originalJapaneseLine": "「奴を、地獄に落とした」",
      "translatedEnglishLine": "\"We sent him to Hell.\""
    },
    {
      "lineNumber": 79954,
      "originalJapaneseLine": "「地獄だと？」",
      "translatedEnglishLine": "\"Hell, you say?\""
    },
    {
      "lineNumber": 79955,
      "originalJapaneseLine": "「陰陽師は本来、地獄の穴を閉じる者……」",
      "translatedEnglishLine": "\"Onmyoji are originally those who close the gates of Hell...\""
    },
    {
      "lineNumber": 79956,
      "originalJapaneseLine": "「だが北条家当主のみ、",
      "translatedEnglishLine": "\"But only the head of the Hojo family"
    },
    {
      "lineNumber": 79957,
      "originalJapaneseLine": "　その穴を開くことも出来る」",
      "translatedEnglishLine": "can also open that gate.\""
    },
    {
      "lineNumber": 79958,
      "originalJapaneseLine": "「その力で、皆の協力を借りて……",
      "translatedEnglishLine": "\"With that power and everyone's help..."
    },
    {
      "lineNumber": 79959,
      "originalJapaneseLine": "　奴を地獄の底にまで叩き落としたんだ」",
      "translatedEnglishLine": "we knocked him down to the bottom of Hell.\""
    },
    {
      "lineNumber": 79960,
      "originalJapaneseLine": "「こんな危険な術……",
      "translatedEnglishLine": "\"Such a dangerous technique..."
    },
    {
      "lineNumber": 79961,
      "originalJapaneseLine": "　本来は使いたくなかったがな」",
      "translatedEnglishLine": "I originally didn't want to use it.\""
    },
    {
      "lineNumber": 79962,
      "originalJapaneseLine": "「ちっ、余計なことを」",
      "translatedEnglishLine": "\"Tch, unnecessary things...\""
    },
    {
      "lineNumber": 79963,
      "originalJapaneseLine": "「殺し損ねちまったじゃねぇか……」",
      "translatedEnglishLine": "\"I ended up missing the kill...\""
    },
    {
      "lineNumber": 79964,
      "originalJapaneseLine": "「あらー、やられちゃいましたねー」",
      "translatedEnglishLine": "\"Oh my, got taken down, huh?\""
    },
    {
      "lineNumber": 79965,
      "originalJapaneseLine": "その場でただ一人、",
      "translatedEnglishLine": "The only one there,"
    },
    {
      "lineNumber": 79966,
      "originalJapaneseLine": "コーラだけが呑気に感想を上げた。",
      "translatedEnglishLine": "was Cola, who carefree voiced her opinion."
    },
    {
      "lineNumber": 79967,
      "originalJapaneseLine": "「いえ、感服しました。",
      "translatedEnglishLine": "\"No, I am impressed."
    },
    {
      "lineNumber": 79968,
      "originalJapaneseLine": "　皆で力を合わせてよく頑張りましたね」",
      "translatedEnglishLine": "Everyone worked well together and did their best.\""
    },
    {
      "lineNumber": 79969,
      "originalJapaneseLine": "「余裕ぶるな。",
      "translatedEnglishLine": "\"Don't get cocky."
    },
    {
      "lineNumber": 79970,
      "originalJapaneseLine": "　あいつはもうこれで終わった。",
      "translatedEnglishLine": "He's finished now."
    },
    {
      "lineNumber": 79971,
      "originalJapaneseLine": "　次はお前だけだ」",
      "translatedEnglishLine": "Next, it’s just you.\""
    },
    {
      "lineNumber": 79972,
      "originalJapaneseLine": "「終わった？",
      "translatedEnglishLine": "\"Finished?"
    },
    {
      "lineNumber": 79973,
      "originalJapaneseLine": "　こんなの終わりとは言えませんよ」",
      "translatedEnglishLine": "You can't call this the end."
    },
    {
      "lineNumber": 79974,
      "originalJapaneseLine": "「勇者はこれくらいで封じることは出来ません」",
      "translatedEnglishLine": "\"A hero can't be sealed by something like this.\""
    },
    {
      "lineNumber": 79975,
      "originalJapaneseLine": "「今のアリオスなら、そうですね……",
      "translatedEnglishLine": "\"Given the current Arios, well..."
    },
    {
      "lineNumber": 79976,
      "originalJapaneseLine": "　一ヶ月もすれば地獄の底から帰ってくるでしょう」",
      "translatedEnglishLine": "in about a month he'll probably come back from the bottom of Hell.\""
    },
    {
      "lineNumber": 79977,
      "originalJapaneseLine": "「一ヶ月だと！？」",
      "translatedEnglishLine": "\"A month!?\""
    },
    {
      "lineNumber": 79978,
      "originalJapaneseLine": "「馬鹿を言うな！",
      "translatedEnglishLine": "\"Don't be ridiculous!"
    },
    {
      "lineNumber": 79979,
      "originalJapaneseLine": "　地獄に落ちれば生き続けることすら不可能だ！」",
      "translatedEnglishLine": "If you fall into Hell, it's impossible even to survive!\""
    },
    {
      "lineNumber": 79980,
      "originalJapaneseLine": "「と言われても、",
      "translatedEnglishLine": "\"Even if you say that,"
    },
    {
      "lineNumber": 79981,
      "originalJapaneseLine": "　勇者ってそういうものですから」",
      "translatedEnglishLine": "heroes are just like that.\""
    },
    {
      "lineNumber": 79982,
      "originalJapaneseLine": "「断言だってしてあげます。",
      "translatedEnglishLine": "\"I'll boldly say it for you."
    },
    {
      "lineNumber": 79983,
      "originalJapaneseLine": "　必ずアリオスは帰ってくる」",
      "translatedEnglishLine": "Arios will definitely come back.\""
    },
    {
      "lineNumber": 79984,
      "originalJapaneseLine": "「そして、貴方達に魔王を守ることは出来ません」",
      "translatedEnglishLine": "\"And you will not be able to protect the Demon Lord.\""
    },
    {
      "lineNumber": 79985,
      "originalJapaneseLine": "「一ヶ月が残された猶予です。",
      "translatedEnglishLine": "\"You have one month left as a grace period."
    },
    {
      "lineNumber": 79986,
      "originalJapaneseLine": "　どうぞ、悔いのない最後の日々を」",
      "translatedEnglishLine": "Please, spend your final days without regrets.\""
    },
    {
      "lineNumber": 79987,
      "originalJapaneseLine": "「では、アリオスを回収しに行くので、",
      "translatedEnglishLine": "\"Well then, I’m going to retrieve Arios,"
    },
    {
      "lineNumber": 79988,
      "originalJapaneseLine": "　私はこれで」",
      "translatedEnglishLine": "so I'll be off now.\""
    },
    {
      "lineNumber": 79989,
      "originalJapaneseLine": "「あ、待ちやがれ！」",
      "translatedEnglishLine": "\"H-Hey, wait!\""
    },
    {
      "lineNumber": 79990,
      "originalJapaneseLine": "「き、消えた……",
      "translatedEnglishLine": "\"H-He disappeared...\""
    }
  ]
}

